import React from 'react';

function PhotoGallery() {
    const testImage = './assets/logo.png'; // Adjust path as necessary

    return (
        <div>
            <h1>Testing Image Load</h1>
            <img src={testImage} alt="Test Image" style={{ width: '100px', height: '100px' }} />
        </div>
    );
}

export default PhotoGallery;
